import React from 'react';
import styled from 'styled-components';

export const Paragraph = styled.p`
	font-size: 1.7rem;
	font-weight: 400;
	font-style: normal;
	line-height: 2.5rem;
	letter-spacing: -.00374rem;
	color: rgb(51, 51, 51);
`;
